Description: Jon Glaser plays a man (&quot;Jon&quot;) in the witness protection program who moves his family to New York City so they can star in a reality TV show, forced to wear balaclavas at all times. Paul Rudd guest-stars in the pilot as himself. Eugene Mirman co-stars as a Russian hitman/stand-up comic hired to kill Jon. This series is produced by Wonder Showzen and Xavier: Renegade Angel creators PFFR. It leans decidedly more towards deadpan humor and does not use the black humor of their other shows. It is similar in format to The Office, in that it mocks a reality show setup, as if it were a serious, non-fiction reality show and not a fictional comedy.

